	IImageService imageService
) : ICleanDataSeeder {

	public async Task SeedAsync(CancellationToken cancellationToken = default) {
		if (!await context.Genders.AnyAsync(cancellationToken))
			await SeedGendersAsync(cancellationToken);

		if (await context.Users.CountAsync(cancellationToken) <= 1)
			await SeedUsersAsync(cancellationToken);

		if (!await context.Countries.AnyAsync(cancellationToken))
			await SeedCountriesAsync(cancellationToken);

		if (!await context.Cities.AnyAsync(cancellationToken))
			await SeedCitiesAsync(cancellationToken);

		if (!await context.RentalPeriods.AnyAsync(cancellationToken))
			await SeedRentalPeriodsAsync(cancellationToken);

		if (!await context.HotelCategories.AnyAsync(cancellationToken))
			await SeedHotelCategoriesAsync(cancellationToken);

		if (!await context.HotelAmenities.AnyAsync(cancellationToken))
			await SeedHotelAmenitiesAsync(cancellationToken);

		if (!await context.Citizenships.AnyAsync(cancellationToken))
			await SeedCitizenshipsAsync(cancellationToken);

		if (!await context.RoomAmenities.AnyAsync(cancellationToken))
			await SeedRoomAmenitiesAsync(cancellationToken);

		if (!await context.Languages.AnyAsync(cancellationToken))
			await SeedLanguagesAsync(cancellationToken);

		if (!await context.Breakfasts.AnyAsync(cancellationToken))
			await SeedBreakfastsAsync(cancellationToken);

		if (!await context.RoomTypes.AnyAsync(cancellationToken))
			await SeedRoomTypesAsync(cancellationToken);
	}

	private async Task SeedGendersAsync(CancellationToken cancellationToken) {
		await context.Genders.AddRangeAsync([
			new() {
				Name = "Чоловік"
			},
			new() {
				Name = "Жінка"
			}
		], cancellationToken);

		await context.SaveChangesAsync(cancellationToken);
	}

